import React from "react";

/* 
-JSX rules
-return single element
-div / section / article / FRAGMEMT
-use camelCase for html attribute
-className instead of class
-close every element
-formatting

*/

export default function Greeting() {
  return (
    <div>
      <h3>Hello world</h3>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
    </div>
  );
}
